={{
 (() => {
 // Passo 1: Pega a data selecionada do campo 'data_selecionada' (formato ISO)
 const data = new Date($('Edit Fields1').item.json.data_selecionada);

// Passo 2: Formata a data e hora para o padrão brasileiro (pt-BR), com dia, mês, ano, hora e minuto
 const horarioFormatado = data.toLocaleString('pt-BR', {
 day: '2-digit',
 month: '2-digit',
 year: 'numeric',
 hour: '2-digit',
 minute: '2-digit'
 });

// Passo 3: Retorna a mensagem final com nome, data formatada e link da reunião
 return `Olá ${$('Edit Fields1').item.json.first_name}, tudo certo?

Sua reunião com a Agência NoCode está confirmada para *${horarioFormatado}*.
 Link da reunião: ${$json.conferenceData.entryPoints[0].uri}

Se precisar reagendar ou tiver dúvidas, é só me mandar um áudio ou mensagem!`;
 })()
}}

